import React from 'react';

const style = {
    backgroundColor: "#5ba7dc",
    textAlign: "center",
    padding: "20px",
    left: "0",
    bottom: "0",
    height: "10vh",
    width: "100%",
}

function Footer() {
    return (
        <>
        <div style={style} />
        </>
    )
}

export default Footer;
